let kartsng = parcel.getFeatureById('cart-grp'), 
kartfwdMove = kartsng.createAnimation('position'),
kartangMove = kartsng.createAnimation('rotation'),  kartgrp = parcel.getFeatureById('cart-grp'), kartgrpMove = kartgrp.createAnimation('position'), strsym = parcel.getFeatureById('start-symbol'), btnFwd = parcel.getFeatureById('fwd'), mvPos = -1, mvRot = 0.5, waiting = false;
waitForDoneo1 = (n, s) => {return new Promise(resolve => {setTimeout(() => {resolve(n)}, s);});};

mvFwd = async () => {
  let waitMv = waitForDoneo1(waiting=true, 100);
  await waitMv;
  kartfwdMove.setKeys([{
      frame: 10,
      value: kartsng.position.add(new Vector3(mvPos,0,0))
    }]);
  kartsng.startAnimations( [kartfwdMove]);
  kartsng.position.x += mvPos;
};

mvgrpFwd = async () => {
  let waitMv = waitForDoneo1(waiting=true, 150);
  await waitMv;
  kartgrpMove.setKeys([{
      frame: 10,
      value: kartgrp.position.add(new Vector3(mvPos*2,0,0))
    }]);
  kartgrp.startAnimations( [kartgrpMove]);
  kartgrp.position.x += (mvPos*2);
  //kartgrp.position.x += mvPos;
};

btnFwd.on('click', e => {
    if (strsym.get('startingPosition') === 0) {
       console.log('rotation sng:', kartsng.rotation.y);
       console.log('rotation grp:', kartgrp.rotation.y); 
       mvFwd();
       mvgrpFwd();
    }
    else {console.log('need to click the start button first!');}
});

